import './App.css';
import React from 'react';
import axios from 'axios';

//const url = 'https://api.openweathermap.org/data/2.5/weather?'

function Resort(props) {
    let url = `https://api.openweathermap.org/data/2.5/weather?lat=${props.lat}&lon=${props.long}&appid=${props.appId}&units=imperial`
    const [res, setRes] = React.useState(null)

    const Component = ({ url }) => {
        React.useEffect(() => {
            axios.get(url, { params: {lat: props.lat, lon: props.long, appid: props.appId, units: "imperial"}}).then((response) => {
                setRes(response.data)
            });
        }, []);

        //if (!res) return null;

        return (
            <div className='Resort'>
                <h1>{props.resortName}</h1>
                <h3>Lat: {props.lat} Long: {props.long}</h3>
                <h4>res: {res} </h4>
            </div>
        );
    }
}

export default Resort;
